import './resume.css';
import React from 'react';
import { Card } from 'react-bootstrap';
import { connect } from 'react-redux';

const Kits = (props) => {

  console.log(props);

  return (
    <div className="container">
        <div className="row">
          <div className="col-lg-4 col-6">
            <Card>
              <Card.Img variant="top" src="https://i.imgur.com/RVdQdr9.jpg"/>
              <Card.Body>
                <Card.Title>Card title</Card.Title>
                <Card.Text>
                  This is a wider card with supporting text below as a natural lead-in to
                  additional content. This content is a little bit longer.
                </Card.Text>
              </Card.Body>
            </Card>
          </div>
          <div className="col-lg-4 col-6">
            <Card>
              <Card.Img variant="top" src="https://i.imgur.com/xgdrvc7.jpg" />
              <Card.Body>
                <Card.Title>Card title</Card.Title>
                <Card.Text>
                  This card has supporting text below as a natural lead-in to additional
                  content.{' '}
                </Card.Text>
              </Card.Body>
            </Card>
          </div>
          <div className="col-lg-4 col-6">
            <Card>
              <Card.Img variant="top" src="https://i.imgur.com/WYlxP1G.jpg" />
              <Card.Body>
                <Card.Title>Card title</Card.Title>
                <Card.Text>
                  This card has supporting text below as a natural lead-in to additional
                  content.{' '}
                </Card.Text>
              </Card.Body>
            </Card>
          </div>
        </div>
    </div>
  )
}

function mapStateToProps(state){
  const kits = state.kitsReducer;
  return {
    resume: kits
  }
}

export default  connect(mapStateToProps)(Kits);
